" title="SESAR"><img class="linkIcon" src="images/sesar-logo.jpg" alt="SESAR"><\/a><\/div>',dwg='<div style="height:1px;width:1px;"><\/div>',$4g='<h1>Welcome to MetPetDB<\/h1> <p><strong>MetPetDB<\/strong> is a database for metamorphic petrology that is being designed and built by a global community of metamorphic petrologists in collaboration with computer scientists at Rensselaer Polytechnic Institute as part of the National Cyberinfrastructure Initiative and supported by the National Science Foundation.<\/p><p>This project will support the development, implementation and population of MetPetDB with the purpose of:<\/p><ol><li><span>archiving published data,<\/span><\/li><li><span>storing new data for ready access to researchers and students,<\/span><\/li><li><span>facilitating the gathering of information for researchers beginning new projects,<\/span><\/li><li><span>providing a search mechanism for data relating to anywhere on the globe,<\/span><\/li><li><span>providing a platform for collaborative studies among researchers, and<\/span><\/li><li><span>serving as a portal for students beginning their studies of metamorphic geology.<\/span><\/li><\/ol><p>Read more about the MetPetDB project <a href="http://wiki.cs.rpi.edu/trac/metpetdb" title="More about MetPetDB">here<\/a>.<\/p>',Lbh='<h2>',Q4g='<html',ICg="<iframe src=\"javascript:''\" name='",d5g='<img class="image-slices" src="images/slices.jpg">',i5g='<img src="images/iphone-sample.png" style = "margin:5px" alt="" class="r"><div style = "width:50%"><h1> iPhone App Released! <\/h1> <p> Download it <a href="http://appshopper.com/link/metpetdb" title="Download MetPetDB">here<\/a>.<\/p><p> The MetPetDB iPhone app is an application for students, teachers, and researchers interested in Geosciences, especially Metamorphic Petrology. It is meant to provide tools needed for field work in Earth Sciences.<\/p><p> It provides access to information contained in the MetPetDB system which contains information about rock samples, subsamples, images, and chemical analyses. Users can search for samples close to their location, at a specific latitude and longitude, or any specifically named geographic location. In addition, searches can be further refined by rock type, metamorphic grade, sample owner and minerals available in the sample. For each sample, users can view all the relevant data available in the database.<\/p><p> <a href="http://wiki.cs.rpi.edu/trac/metpetdb/wiki/IphoneApp" title="More about iPhone app">Learn More<\/a>.<\/p><\/div>',TCg="<img src='",Cwg="<input name='%NAME%' type='radio'/>",Awg="<input type='checkbox'/>",f3g='<span class="cell">',H2g='<span class="cell-contents">Cell Contents: ',G2g='<span class="error-message">',$bh='<span class="igsn">IGSN<\/span> ',_eh='<span id="clear-link"><\/span>',b1g='<span id="page-category" class="hide"><\/span><span id="page-title" class="hide"><\/span><span id="page-desc" class="hide"><\/span><span id="page-actions" class="hide"><\/span>',xah='<span>',p1g='<span>Search for:<\/span> <span id="radio-samples"><\/span><span id="radio-analyses"><\/span>',kch='<strong>',Hfh='<sub>',S8g='<sub>$1<\/sub>',seh='<svg',I1g='<table class="info" cellspacing="0"><tbody>',J8g='<table>',Mwg='<table><tbody>',Dwg='<td',Jwg="<td align='CENTER'>",Lwg='<tr',K8g='<tr class=\\"" + CSS.TYPE_SMALL_CAPS\n\t\t\t\t\t+ "\\"><th>ppm<\/th><th>Element<\/th><\/tr>',N8g='<tr class=\\"" + CSS.TYPE_SMALL_CAPS\n\t\t\t\t\t+ "\\"><th>wt%<\/th><th>Element<\/th><\/tr>',R8g='<tr class=\\""+ CSS.TYPE_SMALL_CAPS +"\\"><th>ppm<\/th><th>Oxide<\/th><\/tr>',T8g='<tr class=\\""+ CSS.TYPE_SMALL_CAPS +"\\"><th>wt%<\/th><th>Oxide<\/th><\/tr>',L8g='<tr><td class="ppm">',O8g='<tr><td class="wt">',J1g='<tr><th>',cah='<tr><th>First Author:<\/th><td>',eah='<tr><th>Full Citation:<\/th><td>',bah='<tr><th>Journal:<\/th><td>',dah='<tr><th>Second Authors:<\/th><td>',aah='<tr><th>Title:<\/th><td>',vbh='<ul>\n<li>Specify Location by:<\/li>\n<li><span id="region"><\/span><\/li>\n<li><span id="coo
